import React from 'react';
import { Row, Container, Col } from 'react-bootstrap';

export const Header = () => {
    return (
        <>
            <Container>
                <Row className="justify-content-md-center">

                    <div id="header-div">
                        <h1>DEVON COX</h1>
                        <h3>UI/UX Designer + Front-End Developer</h3>
                    </div>

                </Row>
            </Container>
        </>

    )
}
